class Solution:
    def maxOperations(self, s: str) -> int:
        res=0
        n=len(s)
        pos=-1
        one=0
        for i in range(n):
            if s[i]=='1':
                one+=1
            if i+1<n and s[i+1]=='0' and s[i]=='1':
                res+=one
        return res
